import React, { Component } from 'react'
import {List, Image} from 'semantic-ui-react'

export class Favorites extends Component {

    // will need user_id 

    handleClick = () => {
        console.log()
    }



    render() {
        return (
            <div>
            <List>
               <List.Item>
                    <Image onClick={() => this.handleClick()} src={this.props.book.volumeInfo.imageLinks.thumbnail} />
                    <List.Content>
                        <List.Header as='a'>Rachel</List.Header>
                            <List.Description>
                            <b>Arrested Development</b>
                            </List.Description>
                    </List.Content>
                </List.Item> 
            </List>
            </div>
        )
    }
}

export default Favorites
